(1, 'Computer Society of India, KJSIT Chapter organizes many workshops, seminars and other technical and non technical events every year for the students. Students work diligently day and night and it helps them in their overall development and inculcates skills like team spirit and leadership. KJSIT has received the best college award from CSI, Mumbai Chapter. Our professor and mentor Mr. Uday Rote has received best HoD award by CSI in 2018. CSI, KJSIT is not a team but a family and we will always remember the time we spent together.\r\n\r\n', 'Computer Society of India, KJSIT Chapter organizes many workshops, seminars and other technical and non technical events every year for the students. Students work diligently day and night and it helps them in their overall development and inculcates skills like team spirit and leadership. KJSIT has received the best college award from CSI, Mumbai Chapter. Our professor and mentor Mr. Uday Rote has received best HoD award by CSI in 2018. CSI, KJSIT is not a team but a family and we will always remember the time we spent together.', '', NULL, , 19),
(2, 'Excellence\r\nWork towards the highest level of service and satisfaction.\r\nUse agile methods and seek innovative solutions to add value.\r\nContinually improve and adopt best practices.\r\n\r\nTeamwork\r\nEncourage staff and volunteers to work together.\r\nRecognise the value of talented individuals working in teams.\r\nBe collaborative and partner with other organisations.', 'Operate professionally and ethically to gain trust.\r\nBe open and honest with each other.\r\nRespect everyone and value each other’s contribution.', 'NA', NULL, , 20),
(3, 'The objective of IEEE (Institute of Electrical and Electronics Engineers) is to foster technological innovation and excellence for the betterment of humanity, while also promoting the advancement of engineering knowledge and professional development globally.', 'IEEE committees serve to facilitate collaboration, innovation, and standardization within specific domains of electrical and electronics engineering, promoting advancements through expert-led initiatives and fostering a global network of professionals dedicated to technological progress.', 'NA', NULL, , 18);

